import React, {useState} from "react";
import {Form, FormControl} from "react-bootstrap"

export default function ImageForm(props) {
    return (
        <div>
            <h1>Image Form</h1>
            <Form>
                <FormControl placeholder="Title"/>
                <FormControl placeholder="Subtitle"/>
                <button>Submit</button>
            </Form>
        </div>
    )
}
